				u.logger.Warn("unexpected error updating actor",
					log.Error(updateErr),
					log.NamedError("originalError", err))
			}
		}()
	}
	return commit, err
}

func (u updateOnErrorLimiter) Usage(ctx context.Context) (int, time.Time, error) {
	return u.nextLimiter.Usage(ctx)
}
